webpackJsonp([0xe603f38e8346],{4320:function(l,i){l.exports={data:{markdownRemark:{html:'<p>2014 年 2 月より一人暮らし再開、東京の下町、南千住に住んでます。 最近ちょっと欲しいものがあるので、節約のため家賃を抑えるべく引っ越しを考えているが、その費用がなかなか貯まらない。誰か<a href="http://kure.danmaq.com">金くれ</a>。</p>\n<h2>◆住まいの遷移</h2>\n<ul>\n<li>2014～現在: 東京都荒川区・南千住。板橋の時に匹敵する部屋の広さ。</li>\n<li>2013～2014: 埼玉県入間郡・毛呂山町。諸事情で 1 年間帰省。</li>\n<li>2009～2013: 東京都墨田区・東向島。スカイツリーの近く。立地の良さの割に手ごろな家賃だった。</li>\n<li>2007～2009: 東京都板橋区・蓮根(レンコン言うなー！)、高島平の近くです。40m2近くとバカみたいに広かった。最近行ってみたら潰れて駐車場になってました。</li>\n<li>2004～2007: 埼玉県比企郡・嵐山町。あの悪名高きレオ……おっと誰か来たようだこれ以上は言わないでおこう。</li>\n<li>1988～2004: 埼玉県入間郡・毛呂山町。1994年頃に一区画隣へ引っ越し。今でもここが実家です。</li>\n<li>1986～1988: 東京都東大和市・仲原。今でも住んでたマンションが健在。(但し全く違う色に塗り替わっている)</li>\n<li>1984～1986: 東京都練馬区・東大泉近辺だと思われるが、正確な場所は不明。白子川のほとりだったのは間違いない。</li>\n<li>1982～1984: 東京都荒川区・西尾久。1 階がタクシー会社。場所が大体この辺くらいしか判らなかったが、最近ようやく発見。</li>\n<li>1981～1982: 東京都葛飾区・亀有で生まれる。現在も祖母の家がそこにあります。</li>\n</ul>',frontmatter:{cover:null,date:"2012-11-27T22:20:00+09:00",strDate:"2012/11/27",title:"代表の生息地"}}},pathContext:{path:"/ja/blog/2012/11/27-代表の生息地/",langKey:"ja"}}}});
